import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { MainPageComponent } from './main-config/main-config.component';



@NgModule({
  declarations: [
    MainPageComponent
  ],
  imports: [
    CommonModule
  ]
})
export class ConfigModule { }
